function Admin_dash() {
    return(
      <div>
        <div className="topnav">
      <h2 id="head"> Portal</h2>
      </div>
        <div class="sidebar">
        <a href="Home.js"><i class="fa fa-fw fa-home" id="navtag"></i> Home</a>
        <a href="#services"><i class="fa fa-fw fa-wrench" id="navtag"></i> Add Books</a>
        <a href="#contact"><i class="fa fa-fw fa-envelope" id="navtag"></i> Book Search</a>
        <a href="#clients"><i class="fa fa-fw fa-user" id="navtag"></i> Book Update</a>
        <a href="#contact"><i class="fa fa-fw fa-envelope" id="navtag"></i> View Order</a>
        <a href="#contact"><i class="fa fa-fw fa-envelope" id="navtag"></i> Log Out</a>
      </div>
      </div>
    );
}
export default Admin_dash;
